import React from 'react';
import { Box, Typography, Paper, Grid, Avatar } from '@mui/material';

const Education = () => {
  return (
   <Box id="education"
   sx={{

    display:'flex',
    textAlign:'center',
    justifyContent:'center',
    alignItems:'center',
    height:'100vh',
    p:2,
    bgcolor:'red',
   }}
   >

    <Box id="genel-kutu"
    sx={{
      bgcolor:'white',
      p:4,
      borderRadius:4,
      boxShadow:6,
      textAlign:'center',
      width:'800px',
      height:'300px',
    }}>
    <Typography variant='h2'
      sx={{
        textAlign:'left',
        pl:5,
        color:'black',
      }}>
       Eğitim
        </Typography>

      
    </Box>
     
   </Box>
  );
};

export default Education;
